import React from 'react';
import { Route, Link } from 'react-router-dom';
import { createGlobalStyle } from 'styled-components';
import LandingPage from "./LandingPage/LandingPage.js";
import Template from "./AlarmListPage/Template";
import Headline from "./AlarmListPage/Headline";
import AlarmList from "./AlarmListPage/AlarmList";
import { AlarmProvider } from './AlarmContext';
import Modal from "./AlarmListPage/Modal";

const GlobalStyle = createGlobalStyle`
  body {
    background: #e9ecef;
  }
`;

function App() {
  return (  
    <div>
      <ul>
        <li>
          <Link to="/">랜딩 페이지</Link>
        </li>
        <li>
          <Link to="/AlarmList">알림 리스트</Link>
        </li>
      </ul>
      <Route path="/" exact={true} component={LandingPage} />
      {/* <Route path="/AlarmListPage" component={AlarmListPage} /> */}
      <AlarmProvider>
      <GlobalStyle />
      <Template>
        <Headline />
        <AlarmList />
      </Template>
      </AlarmProvider>
    </div>


    )
}

export default App;
